(1329, 1, '2019-02-03 10:49:17', '2019-02-03 10:49:17', '[vc_row][vc_column][headertitle image=\"176\"][vc_column_text]\r\n<div class=\"careers-vacancy-content\">\r\n<div class=\"vacancy-details\">\r\n<div class=\"job-tab\">\r\n<div class=\"nav-wrapper\">\r\n<ul class=\"nav\">\r\n 	<li class=\"active\"><a href=\"#overview\" data-toggle=\"tab\">Overview</a></li>\r\n 	<li><a href=\"#responsibilities\" data-toggle=\"tab\">Rsponsibilities</a></li>\r\n 	<li><a href=\"#requirements\" data-toggle=\"tab\">Requirements</a></li>\r\n</ul>\r\n</div>\r\n<div class=\"tab-content\">\r\n<div id=\"overview\" class=\"tab-pane fade in active\">\r\n\r\nThe following are general qualifications and abilities required for the associate consultant intern position at Consult Care. Please check the local office page for any additional requirements.\r\n<ul>\r\n 	<li><i class=\"fa fa-angle-double-right\"></i> Currently studying for a bachelor’s degree from a renowned educational institution.</li>\r\n 	<li><i class=\"fa fa-angle-double-right\"></i> A solid team player who’s also an independent thinker.</li>\r\n 	<li><i class=\"fa fa-angle-double-right\"></i> A robust analytical skill set, an endless curiosity and a penchant for thinking the impossible.</li>\r\n 	<li><i class=\"fa fa-angle-double-right\"></i> Deadline-driven, organized and able to multitask.</li>\r\n 	<li><i class=\"fa fa-angle-double-right\"></i> Strong verbal, written and presentation skills.</li>\r\n 	<li><i class=\"fa fa-angle-double-right\"></i> Fluency in English is mandatory, but please check the local office page for any additional requirements.</li>\r\n 	<li><i class=\"fa fa-angle-double-right\"></i>At the end of the summer, ACIs who have met performance expectations will receive an offer to return full­-time as an associate consultant once they have graduated from college or university.</li>\r\n</ul>\r\n</div>\r\n<div id=\"responsibilities\" class=\"tab-pane fade\">\r\n\r\nSed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. eaque ipsa quae ab illo inventore.\r\n\r\nNemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt.\r\n\r\n</div>\r\n<div id=\"requirements\" class=\"tab-pane fade\">\r\n\r\nSed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. eaque ipsa quae ab illo inventore.\r\n\r\nNemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"apply-job\">\r\n<h2>Apply Here</h2>\r\n</div>\r\n[/vc_column_text][/vc_column][/vc_row]', 'Product 1', '', 'inherit', 'closed', 'closed', '', '433-revision-v1', '', '', '2019-02-03 10:49:17', '2019-02-03 10:49:17', '', 433, 'http://localhost/wordpress_project/2019/02/03/433-revision-v1/', 0, 'revision', '', 0),
